import React from "react";
import PropTypes from "prop-types";

const BranchForm = (props) => {
  const onSubmitBranchForm = (e) => {
    e.target.preventDefault();
    console.log("BranchForm Submitted");
  };

  return (
    <form
      className="contact100-form validate-form"
      name="regform"
      onSubmit={onSubmitBranchForm}
    >
      <div className="wrap-input100">
        <span className="label-input100">Department</span>
        <select className="input100" name="dept">
          <option value="bt">BT</option>
          <option value="ce">CE</option>
          <option value="che">CHE</option>
          <option value="cse">CSE</option>
          <option value="ece">ECE</option>
          <option value="ee">EE</option>
          <option value="me">ME</option>
          <option value="mme">MME</option>
          <option value="cy">CY</option>
          <option value="it">IT</option>
          <option value="dd-bt">DD-BT</option>
          <option value="dd-ch">DD-CH</option>
        </select>
        <span className="focus-input100"></span>
      </div>

      <div className="container-contact100-form-btn">
        <button className="btn-block contact100-form-btn">
          <span>
            Submit
            <i className="fa fa-long-arrow-right m-l-7" aria-hidden="true"></i>
          </span>
        </button>
      </div>
    </form>
  );
};

BranchForm.propTypes = {};

export default BranchForm;
